import React from 'react';
import ReactDOM from 'react-dom';
import './css/global.css';
import ProductRecommendations from './components/catalogue/ProductRecommendations';
import * as serviceWorker from './serviceWorker';

ReactDOM.render(<ProductRecommendations />, document.getElementById('root'));

serviceWorker.unregister();
